from random import randrange


def sattoloCycle(items):
    i = len(items)
    while i > 1:
        i -= 1
        j = randrange(i)  # 0 <= j <= i-1
        items[j], items[i] = items[i], items[j]
    return items

n = int(input())
students = [input() for _ in range(n)]
friends = sattoloCycle(students[::])


for pare in zip(students, friends):
    print(" - ".join(pare))


